import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import Header from '../components/Header/Header'

const Cart = () => {
  return (
    <View style={s.container}>
      <Header/>
    </View>
  )
}

export default Cart

const s = StyleSheet.create({
    container: {
        paddingTop: 50,
        backgroundColor: 'red',
        flex
    }
})
